import { useEffect, useState } from 'react';
import { bookables } from './bookable';
import afterFrame from 'afterframe';
import { measureInteraction } from './utils';

export const SVGRenderer = () => {
  const interaction = measureInteraction();
  const [html, setHtml] = useState(null);

  useEffect(() => {
    (async () => {
      setHtml(svgBody);
    })();
  }, []);

  useEffect(() => {
    if (html) {
      bookables.forEach((bookable) => {
        const bookableId = bookable.venueBookableId;
        const isAvailable = bookable.count > 0;

        const seatEl = document.querySelector(`#${bookableId}`);

        if (seatEl && isAvailable) {
          seatEl.style.fill = 'green';
        }
      });

      afterFrame(() => {
        interaction.end('SVG-renderer');
      });
    }
  }, [html]);

  const handleClick = (event) => {
    const interaction = measureInteraction();

    if (event.target.id) {
      const clickedSeatId = event.target.id;
      bookables.forEach((bookable) => {
        const bookableId = bookable.venueBookableId;
        const isAvailable = bookable.count > 0;
        if (bookableId === clickedSeatId) {
          if (isAvailable) {
            const seatEl = document.querySelector(`#${clickedSeatId}`);
            seatEl.style.fill = 'red';
          }
        }
      });
    }

    afterFrame(() => {
      interaction.end('svg-click');
    });
  };

  return (
    <div
      style={{ border: '1px solid black', padding: 16 }}
      onClick={handleClick}
    >
      <div dangerouslySetInnerHTML={{ __html: html }} />
    </div>
  );
};

